import styled from "styled-components";
import Toggle from "./Toggle";

const StyledToggle = styled(Toggle)`
  color: #03a9f3;
  cursor: pointer;
  padding: 5px 0 0 0;
  outline: 0;
  border: 0;
  background: transparent;
`;

export default StyledToggle;
